package com.frysning.springdnd.player_class;import com.fasterxml.jackson.annotation.JsonProperty;import javax.persistence.*;@Entity@Table(name = "player_class")public class PlayerClass {	@JsonProperty(index = 1)	private @Id	@GeneratedValue(strategy = GenerationType.IDENTITY) Long id;	@JsonProperty(index = 2)	private String name;	public Long getId() {		return id;	}	public void setId(Long id) {		this.id = id;	}	public String getName() {		return name;	}	public void setName(String name) {		this.name = name;	}}